router.get('/:key', async (req, res) => {
    let response = "";
    try {
        const { key } = req.params;
        response = await axios({
            url: `${url}/files?key=${key}`,
            method: "GET",
            headers: headers,
        });
        res.status(200).json(response.data);
    } catch (error) {
        res.status(200).json(error);
    }
})

